var title_f5_3_5174="Enterobiasis life cycle";
var content_f5_3_5174=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F57681&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F57681&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 487px\">",
"   <div class=\"ttl\">",
"    Enterobiasis life cycle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 467px; height: 533px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Eggs are deposited on perianal folds",
"    <strong>",
"     (1)",
"    </strong>",
"    . Self-infection occurs by transferring infective eggs to the mouth with hands that have scratched the perianal area",
"    <strong>",
"     (2)",
"    </strong>",
"    . Person-to-person transmission can also occur through handling of contaminated clothes or bed linens. Enterobiasis may also be acquired through surfaces in the environment that are contaminated with pinworm eggs (eg, curtains, carpeting). Some small number of eggs may become airborne and inhaled. These would be swallowed and follow the same development as ingested eggs. Following ingestion of infective eggs, the larvae hatch in the small intestine",
"    <strong>",
"     (3)",
"    </strong>",
"    and the adults establish themselves in the colon",
"    <strong>",
"     (4)",
"    </strong>",
"    . The time interval from ingestion of infective eggs to oviposition by the adult females is about one month. The life span of the adults is about two months. Gravid females migrate nocturnally outside the anus and oviposit while crawling on the skin of the perianal area",
"    <strong>",
"     (5)",
"    </strong>",
"    . The larvae contained inside the eggs develop (the eggs become infective) in four to six hours under optimal conditions",
"    <strong>",
"     (1)",
"    </strong>",
"    . Retroinfection, or the migration of newly hatched larvae from the anal skin back into the rectum, may occur but the frequency with which this happens is unknown.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Centers for Disease Control and Prevention. Parasites and Health: Enterobiasis. Available at:",
"     <a href=\"file://www.dpd.cdc.gov/dpdx/html/enterobiasis.htm\" target=\"_blank\">",
"      file://www.dpd.cdc.gov/dpdx/html/enterobiasis.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
