var title_f5_3_5181="Major causes of edema by primary mechanism";
var content_f5_3_5181=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F53550&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F53550&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Major causes of edema by primary mechanism",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Increased capillary hydraulic pressure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        A. Increased plasma volume due to renal Na+ retention",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Heart failure, including cor pulmonale",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Primary renal sodium retention",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        a. Renal disease, including the nephrotic syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        b. Drugs: minoxidil, diazoxide, thiazolidinediones, calcium channel blockers (particularly nifedipine), nonsteroidal anti-inflammatory drugs, fludrocortisone, estrogens",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        c. Refeeding edema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        d. Early hepatic cirrhosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Pregnancy and premenstrual edema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        4. Idiopathic edema, when diuretic induced",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        B. Venous obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Cirrhosis or hepatic venous obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Acute pulmonary edema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Local venous obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        C. Decreased arteriolar resistance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Calcium channel blockers (?)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Idiopathic edema (?)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Hypoalbuminemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        A. Protein loss",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Nephrotic syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Protein-losing enteropathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        B. Reduced albumin synthesis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Liver disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Malnutrition",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Increased capillary permeability",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A. Idiopathic edema (?)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B. Burns",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C. Trauma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        D. Inflammation or sepsis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        E. Allergic reactions, including certain forms of angioedema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        F. Adult respiratory distress syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        G. Diabetes mellitus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        H. Interleukin-2 therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I. Malignant ascites",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Lymphatic obstruction or increased interstitial oncotic pressure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A. Lymph node dissection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B. Nodal enlargement due to malignancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C. Hypothyroidism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        D. Malignant ascites",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Uncertain mechanism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A. Docetaxel",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B. Pramipexole",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
