var title_f5_3_5183="Secondary prevention early-onset GBS disease among newborns";
var content_f5_3_5183=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F56780&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F56780&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Secondary prevention of early-onset group B streptococcal (GBS) disease among newborns",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 429px; height: 477px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Full diagnostic evaluation includes a blood culture, a complete blood count (CBC) including white blood cell differential and platelet counts, chest radiograph (if respiratory abnormalities are present), and lumbar puncture (if patient is stable enough to tolerate procedure and sepsis is suspected).",
"     <br>",
"      <font class=\"bullet\">",
"       &bull;",
"      </font>",
"      Antibiotic therapy should be directed toward the most common causes of neonatal sepsis, including intravenous ampicillin for GBS and coverage for other organisms (including",
"      <em>",
"       Escherichia coli",
"      </em>",
"      and other gram-negative pathogens) and should take into account local antibiotic resistance patterns.",
"      <br>",
"       &Delta; Consultation with obstetric providers is important to determine the level of clinical suspicion for chorioamnionitis. Chorioamnionitis is diagnosed clinically, and some of the signs are nonspecific.",
"       <br>",
"        <font class=\"lozenge\">",
"         &loz;",
"        </font>",
"        Limited evaluation includes blood culture (at birth) and CBC with differential and platelets (at birth and/or at 6 to 12 hours of life).",
"        <br>",
"         &sect; Indications for GBS prophylaxis are discussed in the text.",
"         <br>",
"          &yen; If signs of sepsis develop, a full diagnostic evaluation should be conducted and antibiotic therapy initiated.",
"          <br>",
"           &Dagger; If &ge;37 weeks' gestation, observation may occur at home after 24 hours if other discharge criteria have been met, access to medical care is readily available, and a person who is able to comply fully with instructions for home observation will be present. If any of these conditions is not met, the infant should be observed in the hospital for at least 48 hours and until discharge criteria are achieved.",
"           <br>",
"            &dagger; Some experts recommend a CBC with differential and platelets at age 6 to 12 hours.",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Centers for Disease Control and Prevention. Prevention of perinatal group B streptococcal disease: Revised guidelines from CDC, 2010. MMWR 2010; 59 (No. RR-10):22.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
